import React from 'react';
import './Dashboard.css';

const vehicles = [
  { name: 'Toyota Camry', mileage: 32000, oilChangeDue: true },
  { name: 'Honda Accord', mileage: 27000, oilChangeDue: false },
  { name: 'Ford F-150', mileage: 45000, oilChangeDue: true },
];

function Dashboard() {
  return (
    <div className="dashboard">
      <h1>Vehicle Overview</h1>
      <div className="vehicle-list">
        {vehicles.map((vehicle, index) => (
          <div className="vehicle-card" key={index}>
            <h3>{vehicle.name}</h3>
            <p>Mileage: {vehicle.mileage.toLocaleString()} km</p>
            <p>
              Oil Change Due:{' '}
              <strong style={{ color: vehicle.oilChangeDue ? 'red' : 'green' }}>
                {vehicle.oilChangeDue ? 'Yes' : 'No'}
              </strong>
            </p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
